import React, { useEffect, useState } from 'react';
import './style.css';
function App() {
  const [data, setData] = useState([]);
  // get Data
  useEffect(() => {
    fetch('http://localhost:9000/ApiYoutube')
      .then((res) => res.json())
      .then((data) => {
        console.log('data:', data);
        setData(data);
      });
  }, []);
  return (
    <div className='Flex'>
      <div className='App'>
        <h1>GET API </h1>
        <table border='1'>
          <tbody>
            <tr>
              <td>ID</td>
              <td>Name</td>
              <td>Email</td>
              <td>Password</td>
            </tr>
            {data.map((item, i) => (
              <tr key={i}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.email}</td>
                <td>{item.password}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className='App'>
        <h1>POST API </h1>
        <input type='text' placeholder='Name' /> <br />
        <input type='email' placeholder='Email' /> <br /> <br />
        <input type='password' placeholder='password' /> <br /> <br />
        <button type='button'>Add User</button>
      </div>
    </div>
  );
}

export default App;
